ct_form','',0),(16,1,'2015-11-27 16:51:30','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2015-11-27 16:51:30','0000-00-00 00:00:00','',0,'http://fairfaxstars.dev/?p=16',0,'post','',0),(17,1,'2015-11-27 16:51:33','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2015-11-27 16:51:33','0000-00-00 00:00:00','',0,'http://fairfaxstars.dev/?p=17',0,'post','',0),(31,1,'2014-02-24 18:04:55','2014-02-24 18:04:55','<h3>Announcements</h3>\r\n[post_grid type=\"blog_cat\" columns=\"2\" counts=\"4\" cats=\"3\" posts=\"\" order=\"DESC\" orderby=\"date\" filter=\"no\" paging=\"no\"]\r\n\r\n&nbsp;\r\n\r\n[tagline title=\"Nike Affiliate\" link=\"\"]\r\n\r\n<img class=\"size-medium wp-image-308 aligncenter\" style=\"margin-top: 25px;\" src=\"http://stars.jps26.com/wp-content/uploads/sites/17/2014/02/nike-logo-300x107.png\" alt=\"nike-logo\" width=\"100\" height=\"auto\" />\r\nThe Fairfax Stars organization is proud to be recognized as one of the premier AAU basketball programs in America and incredibly proud of all of the student-athletes that participate. The success of any season is not determined by wins and losses, rather by the improvement of the players in their skills, self-confidence, knowledge, and love for the game of basketball.[/tagline]\r\n\r\n&nbsp;\r\n\r\n[twitter_carousel counts=\"5\" cache=\"12\" auto=\"true\" speed=\"800\" pause=\"5000\" mode=\"fade\"]','Home','','publish','closed','open','','home-3','','','2015-11-28 19:53:03','2015-11-28 19:53:03','',0,'http://challenge.dev/?page_id=31',0,'page','',0),(33,1,'2014-02-24 18:04:55','2014-02-24 18:04:55','','Latest News','','publish','closed','open','','latest-news','','','2014-02-24 18:04:55','2014-02-24 18:04:55','',0,'http://challenge.dev/?page_id=33',0,'page','',0),(54,1,'2014-02-24 18:30:23','2014-02-24 18:30:23','','About Us','','publish','open','open','','about-us','','','2014-02-24 18:30:23','2014-02-24 18:30:23','',0,'http://challenge.dev/?page_i