nty','2014 - Player Participation Fee','Please note that the \"Out of County\" fee is an <strong>additional</strong> cost to the participation fee.','publish','open','closed','','2014-player-participation-fee','','','2014-02-25 14:28:37','2014-02-25 14:28:37','',0,'http://challenge.dev/?post_type=product&amp;p=142',0,'product','',0),(143,1,'2014-02-25 14:27:45','2014-02-25 14:27:45','','Variation #143 of 2014 â Player Participation Fee','','publish','open','open','','product-142-variation','','','2014-02-25 14:27:45','2014-02-25 14:27:45','',0,'http://challenge.dev/product_variation/product-142-variation/',0,'product_variation','',0),(144,1,'2014-02-25 14:28:05','2014-02-25 14:28:05','','Variation #144 of 2014 â Player Participation Fee','','publish','open','open','','product-142-variation-2','','','2014-02-25 14:28:05','2014-02-25 14:28:05','',0,'http://challenge.dev/product_variation/product-142-variation-2/',1,'product_variation','',0),(149,1,'2014-02-25 14:42:50','2014-02-25 14:42:50','','Variation #149 of 2014 â Fairfax Stars Girls Tournament of Champions','','publish','open','open','','product-148-variation','','','2014-02-25 14:42:50','2014-02-25 14:42:50','',0,'http://challenge.dev/product_variation/product-148-variation/',0,'product_variation','',0),(150,1,'2014-02-25 14:43:20','2014-02-25 14:43:20','','Variation #150 of 2014 â Fairfax Stars Girls Tournament of Champions','','publish','open','open','','product-148-variation-2','','','2014-02-25 14:43:20','2014-02-25 14:43:20','',0,'http://challenge.dev/product_variation/product-148-variation-2/',1,'product_variation','',0),(151,1,'2014-02-25 14:51:20','2014-02-25 14:51:20','','pink','','publish','closed','closed','','pink','','','2014-02-25 14:51:20','2014-02-25 14:51:20','',0,'http://challenge.dev/?post_type=shop_coupon&amp;p=151',0,'shop_coupon','',0),(153,1,'2014-02-25 15:05:49','2014-02-25 15:05:49','2014 THINK PINK Girls Tournament of Champions will be played April 5th - 6th. This is the two day, 4-game option.','2014 Fairfax Stars Girls Tournament of Champions - 4 Games','Multi team coupon code: PINK','publish','open','closed','','2014-fairfax-stars-girls-tournament-of-champions-4-games','','','2014-02-25 15:05:49','2014-02-25 15:05:49','',0,'http://challenge.dev/?post_type=product&amp;p=153',0,'product','',0),(156,1,'2014-02-25 15:06:28','2014-02-25 15:06:28','2014 THINK PINK Girls Tournament of Champions will be played April 5th - 6th. This is the one day, 3-game option.','2014 Fairfax Stars Girls Tournament of Champions - 3 Games','','publish','open','closed','','2014-fairfax-stars-girls-tournament-of-champions-3-games','','','2014-02-25 15:06:28','2014-02-25 15:06:28','',0,'http://challenge.dev/?post_type=product&amp;p=156',0,'product','',0),(190,1,'2014-02-25 16:51:24','2014-02-25 16:51:24','','Coaches','','publish','open','open','','coaches','','','2014-02-25 16:51:24','2014-02-25 16:51:24','',54,'http://challenge.dev/?page_id=190',0,'page','',0),(192,1,'2014-02-25 16:51:41','2014-02-25 16:51:41','During the summer of 1996, Aggie McCormick decided to move boldly to pursue a dream that she had to start an AAU basketball program that would offer more opportunities for community youth. She knew that while there were a couple of choices for girls in the area who wished to compete at the AAU level, there was no meaningful local northern virginia organization thatÂ was availableÂ in the Fairfax County area for boysÂ to play AAU basketball without having to travel to Maryland or the District of Columbia.\n\nWhat Aggie did not realize at the time, was that there was also a growing demand for more opportunities for young girls to play AAU basketball. As a former coach with another AAU organization, as well as a high school coach, Aggie quickly learned that there were more potential players who wanted to play AAU basketball than there were opportunities. Accordingly, with the help of Bob McCormick, Bob Dix,Â and a few others, Aggie founded the Fairfax Stars AAU basketball program with plans to field teams for the 1997 AAU season. The organization would include teams for boys and girls and the goal of the Fairfax Stars was simple and clear. We would invite qualifiedÂ coaches to join the program who shared a knowledge and commitment to fundamental skill development for the student-athletes whose ambition was to compete at the AAU level with the Fairfax Stars. The measure of success would not be calculated by wins and losses, but whether each player improved their skills and their knowledge of the game of basketball from the beginning of the season until the end of the season. All in an environment of positive reinforcement and fun.\n\nEveryone in the Fairfax Stars organization is a volunteer. Early on, Aggie set out to identify a group of individuals who shared her passion for working with young people and who would volunteer to accept the challenges and responsibilities of serving on the Stars Board of Directors. The organization was incorporated and has been a member of the Potomac Valley AAU region and the national AAU ( Amateur Athletic Union ) organization since the inception of competitive participation in 1997. Additionally, Stars teams are eligible and many also compete in YBOA ( Youth Basketball of America ) local, state and nationalÂ tournaments.\n\nSince the inaugural season in 1997, overÂ 3,000 student-athletes have competed on Fairfax Stars teams. During that period, the skill development instruction has helped many players improve and compete at a high level in AAU competition. The Stars have become well known throughout the United States by competing AAU organizations, and by college scouts and coaches from across the country. The Fairfax Stars have enjoyed tremendous success at Regional and National AAU Championships as well as State and National YBOA Championships. While participating in national tournaments is not the underlying goal of the organization, the history of success is no doubt the result of the Stars continuing commitment to skill development and improved knowledge of the game.\n\n<img alt=\"\" src=\"http://www.fairfaxstars.org/data/lib/stars52A.JPG\" />\n\nIn the short history of this unique program, boys and girls teams have won several Potomac Valley Regional Championships, along with numerous silver and bronze medals.Â  The program has also had more than a dozen of its teams nationally ranked at the end of an AAU season.Â  One of our girls teams has won 6 consecutive Potomac Valley championships, and has finished as one of the top 3 teams in the nation in their age group for 5 consecutive years, includingÂ two National Championships!Â  Most of those players are now continuing their education and competing at the collegiate level.\n\nIn addition to the regular season AAU basketball activites, the Fairfax Stars also conduct a Summer Basketball League for all levels of basketball that has grown from a group of 20 teams playing on outside courts in 1998, to an amazing cadre of County League, House League, Church League, Independent, AAU, and High School teams in a variety of divisions that approached 300 teams in 2006.Â  The popularity of this league and the ability to provide organized, constructive summertime recreation activity with adult supervision for community youth has been an incredible contribution to the area.\n\nIn 2002, the Fairfax Stars girls and boys programsÂ were recognized as one of the top AAU organizations in the Nation, with the girls program being ranked as the 7th best in the Nation, and the boys program ranked in the top 20.\n\n2003Â was another spectacular year.Â  With 25 teams and over 300 players, the Stars program continues to grow representing the increasingÂ interest within the community to participate in basketball skills development.Â  The talented coaches continue toÂ teach and to provide exciting opportunities for the players to improve their skills and their knowledge of the game.Â  15 of the teams earned invitations to National Championship tournaments and will travel to cities throughout the United States to represent theÂ Potomac Valley region and the Fairfax Stars AAU Basketball program.Â  From Cocoa Beach, Florida to Sacramento, California...from Memphis, Tennessee to Dayton, Ohio...from Virginia Beach, Virginia to Kenner, Louisiana, these student-athletes compete at the highest level, and represent their community with pride and determination.Â  The Stars are truly shining bright!\n\nBoys teams had tremendous success at the national level in 2003 with several teams finishing in the national top 20 in their respective age groups.Â  The girls program had another spectacular year, claimingÂ <em><span style=\"text-decoration: underline\">two</span></em>Â national championships and a 5th place finish, along with outstanding performances from several other teams on the national stage.Â  The 15 year old girls defied the odds and rebounded from a loss in the winner\'s bracket semifinals, to win 5 straight games in the loser\'s bracket to earn a spot in the championship game.Â  After beating Oklahoma to force a playback game, the Stars prevailed, winning their 3rd National Championship since they were 10.Â  Four of those players ( Brittany Mitch, Laura Haskins, Lauren Arthur, Kendra King ) have been teammates for all three national championships ( 10, 13 &amp; now 15 ), as well as a 2nd ( 11 years old ) and two 3rd\'s ( 12 &amp; 14 years old ).\n\n<img alt=\"\" src=\"http://www.fairfaxstars.org/data/lib/200315-girlsedited.JPG\" />\n2003 AAU 15 &amp; Under Girls National Champions!\n\nAdditionally, the 13 year old girls team traveled to Dayton, Ohio for the 2003 AAU National Championship tournament and entered the competition among 96 teams from across the United States as the #13 seeded team.Â  The Stars team was the only team to go undefeated ( 9 - 0 ) and defeated the defending national champion in the final game to claim the 2003 National Championship.\n\n<img alt=\"\" src=\"http://www.fairfaxstars.org/data/lib/national-champs.jpg\" />\n2003 AAU 13 &amp; Under Girls National Champions!\n\nThe 2004 AAU basketball season saw the Fairfax Stars field 36 teams of highly competitive girls and boys teams and is evidence of the tremendous interest in the community for this outstanding program.Â  The ongoing commitment to teaching basketball skills and a knowledge of the game has gained a reputation that has extended the reach of the program throughout not only the Potomac Valley region, but the entire United States.Â  Folks have heard of the Fairfax Stars and the success that is produced by maintaining its focus on developing players and preparing them to compete at a high level, while growing their love for this magnificent game of basketball.\n\n<img alt=\"\" src=\"http://www.fairfaxstars.org/data/lib/2004U12NationalChamps.jpg\" />\n( 2004 U12 National Champion Fairfax Stars )\n\nA huge majority of the teams qualified for post-season tournament play in either AAU or YBOA, and 12 teams qualified to compete in National Championship tournaments.Â  The 12 year old girls won the Potomac Valley AAU Regional Gold Medal and advanced to the 12 &amp; Under Girls AAU National Championship Tournament in Kingsport, Tennessee, where they went undefeated ( 9 - 0 ) and won the 2004 AAU National Championship.Â  This was the 5th AAU National Championship trophy earned by the Fairfax Stars in just 8 short years of their history.\n\n2004 also saw the Fairfax Stars AAU Basketball program selected for an affiliate relationship with Nike.Â  The Fairfax Stars girls program became a Nike-afffiliate program, adding to the opportunities for participation in tournaments, camps, and clinics.Â  At the end of the 2004 season, the Fairfax Stars were ranked as the 6th best AAU girls basketball program in America and the boys program remained in the top 20.\n\nAdditionally, due to demand, the Fairfax Stars also launched a Fall Basketball League which has been another resounding success.Â  The Stars also initiated a Fairfax Stars Summer Breeze Golf Tournament that will be an annual event with all proceeds committed to the Fairfax Stars Scholarship Fund.\n\n2005 saw the Fairfax Stars AAU basketball program grow to more than 35 teams for boys and girls, and the season produced significant on and off court success.Â  Several other significant events and developments occurred as well.Â  The Fairfax Stars Hall of Fame recognized and inducted a number of graduating high school seniors that had participated with the Fairfax Stars throughout their AAU basketball careers and presented those players with encased jerseys to honor their contributions to the sucess of the program.Â  Additionally, the team that won 3 AAU National Championships and never finished below 3rd in the nation from the time they were 10 years old throughout their participation at AAU Nationals, was honored as a team.\n\nThe 2005 season also produced the first national championships on the boys side as the 13 year old boys-gold teamÂ experienced an exciting run to the final and came home with the 2005 AAU Division II National Championship.Â  Additionally, the 12 year old boys-gold team had an outstanding tournament as they won the 2005 YBOA National Championship.Â  The program again received national recognition as the girls program was again ranked 6th in the United States and the boys moved closer to the top 10.\n\nAs the 2005 - 2006 NCAA basketball season gets underway, more than 25 players who participated primarily if not exclusively with the Fairfax Stars AAU program, are competing in college basketball.Â  What clear and compelling evidence of the results of the commitment to skills development and learning the game of basketball in order to achieve excellence...both on and off the court.\n\nAdditionally, in response to requests from many parents, players, and teams, the Fairfax Stars launched the Fairfax Stars Winter AAU Basketball League.Â  This is intended for those student-athletes and teams that desire to continue competing in AAU level competition and is not intended in any way to compete with long time existing basketball programs.Â  The Fairfax Stars remain strong supporters of the Fairfax County Youth Basketball League.\n\nAs hard as it is to believe, the 2006 AAU season represents the 10th year that the Fairfax Stars will be competing in AAU and YBOA girls and boys basketball competition.Â  Maintaining a commitment toÂ <em>\"striving for excellence...on and off the court!\"</em>Â has established the Fairfax Stars AAU basketball program as one of the premier youth basketball organizations in the nation and the founder, Board of Directors, coaches, administrators and volunteers...in addition to all of the players...are justifiably proud.\n\nThe season itself produced another year of outstanding results...both on and off the court.Â  The 9 year old girls finished 9th in the nation for the second consecutive year, the 10 year old girls finished 5th at AAU Nationals, as did both the 15 year old and 16 year old girls ( their 4th consecutive year in the top 5, including a national championship in 2003 and a runner-up finish in 2005 ).Â  Additionally, the 13 year old boys-Gold team finished in the top 10 at YBOA Nationals and several other teams participated in national championship tournaments, including the 13 year old boys-Maroon team that participated in the AAU Division I Boys National Championship tournament for the second consecutive year.\n\nThe 16 year old girls elite travel team had a spectacular summer primarily during the college exposure period of the month of July.Â  Demonstrating unbelievable consistency unlike any other travel team in the country, the Stars advanced to the championship game of the prominent early-season Boo Williams Invitational in April and then went on the road during most of July.Â  The Stars traveled to the prestigious OregonÂ <em>\"End of the Trail\"</em>Â tournament and finished 3rd out of 192 teams with one player named as a co-MVP and several named to the all-tournament team.Â  The Stars then traveled to Orlando, where they finished 5th in the nation at the 2006 AAU Nationals, losing by one point to the eventual national champion.Â  Then the Stars competed in the 2006 U17 U. S. Junior Nationals and finished 5th out of 144 teams that competed.Â  Closing out the month of July, the Stars were invited as one of the top women\'s travel teams in the country to be one of 24 teams to compete in the spectacular Nike Nationals Invitational tournament in Augusta, South Carolina.\n\nCompeting against the absolutely best players and teams in the country, the Stars advanced to the final of the Silver Division Championship and completed an amazing 24 - 6 run during the month of July, playing in front of head coaches from the top women\'s college and university basketball programs in America.\n\nFollowing the 2006 season, the Fairfax Stars girls program was ranked as the #3 program in America.Â  The boys continued to be a top 20 national program.\n\n2006 also saw the very first Fairfax Stars Casino Night with proceeds devoted to a number of programs including the Fairfax Stars Scholarship Fund.Â  The Fairfax Stars Hall of Fame banquet was an inspirational, teary celebration of another group of student-athletes and adults that have made such important contributions to the organization.\n\nThe fall of 2006 also saw the launch of the first Fairfax Stars Team Showcase for players to get exposure to attending college coaches, as well as the first Fairfax Stars Premier Coach\'s Clinic that featured 13 of the top women\'s and men\'s college coaches that volunteered their time to provide instruction for area basketball coaches.\n\nThe first 10 years have been amazing.Â  Led by a talented, enthusiastic, and dynamic Executive Director, Aggie McCormick-Dix is realizing a dream of providing enormous opportunities for the youth of our community, and in doing so, also teaching about character and citizenship which is all a part of the vision...<em>\"striving for excellence...on and off the court!\"</em>.Â  The short history is rich...the impact has been dramatic..and the future is extremely exciting and bright!Â  GO STARS!!\n\nFor more information about this outstanding program, please contact us atÂ <a href=\"mailto:fairfaxstars@aol.com\">fairfaxstars@aol.com</a>.','History','','publish','open','open','','history','','','2014-02-25 16:51:41','2014-02-25 16:51:41','',54,'http://challenge.dev/?page_id=192',0,'page','',0),(194,1,'2014-02-25 16:51:53','2014-02-25 16:51:53','The motivating philosophy of the Fairfax Stars AAU basketball program is a commitment to provide fundamental skill development instruction and to teach the elements of the game of basketball itselfÂ for young student-athletes in our community ( boys &amp; girls ) who have a desire to compete at a high level of AAU basketball competition.\n\nOur program and all of our coaches are committed to providing an opportunity for players to expandÂ their skill...theirÂ knowledgeâ¦and their love forÂ the game of basketballâ¦in an environment of positive reinforcement that teaches about respect, discipline, teamwork, sportsmanship, commitment and hard work. The Fairfax Stars program also stresses theÂ need for strong academics to achieve the true standing of a successful student-athlete.\n\nThe goal is to always strive for excellenceâ¦both on and off the court!','Philosophy','','publish','open','open','','philosophy','','','2014-02-25 16:51:53','2014-02-25 16:51:53','',54,'http://challenge.dev/?page_id=194',0,'page','',0),(215,1,'2014-02-25 17:02:55','2014-02-25 17:02:55','One of the basic tenets of the Fairfax Stars AAU basketball program is that every effort is made to insure that no student-athlete is unable to participate as a result of economic hardship.Â  Accordingly, four years ago, through the kindness of a number of generous benefactors, the Fairfax Stars Scholarship Program was established.\n\nEach year, a number of full and partial scholarships are awarded to candidates based on criteria similar to the Fairfax County Scholarship program and following a review and evaluation of the application by the Fairfax Stars Scholarship committee.\n\nFor more information, please send an e-mail to:Â <a href=\"mailto:fairfaxstars@aol.com\">fairfaxstars@aol.com</a>Â and the inquiry will be forwarded to the Chairman of the committee.\n\n**Note-Â  Scholarships are only available for registration fees and all applications will require accompanying documentation to be eligible for consideration.','Scholarship Program','','publish','open','open','','scholarship-program','','','2014-02-25 17:02:55','2014-02-25 17:02:55','',54,'http://challenge.dev/?page_id=215',0,'page','',0),(218,1,'2014-02-25 17:04:07','2014-02-25 17:04:07','[team_members]\n\n[team_member avatar=\"http://stars.jps26.com/wp-content/uploads/sites/17/2014/02/avatar-placeholder.jpg\" name=\"Ms. Aggie McCormick-Dix\" role=\"Founder &amp; Executive Director\"]\n<a href=\"mailto:fairfaxstars@aol.com\">fairfaxstars@aol.com</a>\n(703) 281-5203\n[/team_member]\n\n[team_member avatar=\"http://stars.jps26.com/wp-content/uploads/sites/17/2014/02/avatar-placeholder.jpg\" name=\"Ms. Amanda Lockey\" role=\"Administrative Assistant\"]\n<a href=\"mailto:g0ssgirl@aol.com\">g0ssgirl@aol.com</a>\n[/team_member]\n\n[team_member avatar=\"http://stars.jps26.com/wp-content/uploads/sites/17/2014/02/avatar-placeholder.jpg\" name=\"Jason Simpson\" role=\"Girl\'s Commissioner\"]\n\n<a href=\"mailto:jasonwsimpson@cox.net\">jasonwsimpson@cox.net</a>\n[/team_member]\n\n[team_member avatar=\"http://stars.jps26.com/wp-content/uploads/sites/17/2014/02/avatar-placeholder.jpg\" name=\"Lyle Wright\" role=\"Boy\'s Commissioner\"]\n<a href=\"mailto:topowright@gmail.com\">topowright@gmail.com</a>\n[/team_member]\n\n[/team_members]\n\n&nbsp;\n\n[team_members]\n\n[team_member avatar=\"http://stars.jps26.com/wp-content/uploads/sit